import React from "react";
import TimeTableComponent from "../components/time-table/TimeTableComponent";

const TimeTable = () => {
  return (
    <div>
      <p>Note: Add event with double click on the timetable.</p>
      <TimeTableComponent />
    </div>
  );
};

export default TimeTable;
